import React from "react";

function Page({ page }) {

    return (
        <div className="page">
            <div className="date-box">
                <h2>{page.day}</h2>
                <h2>{page.month}</h2>
            </div>
            {/* <button onClick={() => console.log(currentPage)}>button</button> */}
        </div>
    )
}

export default Page;
